public void setInterpreter(ReservationRequestInterpreter interpreter) {
  maybeInitBuilder();
  if (interpreter == null) {
    builder.clearInterpreter();
    return;
  }
  builder.setInterpreter(convertToProtoFormat(interpreter));
}
